import React from "react"

function BlogPost(props) {
    return (
        <div>
            <p> Title: {props.item.title}</p>
            <p> Sub: {props.item.subTitle}</p>
            <p>Author: {props.item.author}</p>
            <p>Date: {props.item.date}</p>
        </div>
    )
}

export default BlogPost
